#include <iostream>
#include <unordered_set>
#include <map>
#include <vector>


int dp(const std::string& s) {
  static constexpr int max_dp_size = 50000;
  int value[max_dp_size] = {0};

  int size = s.size();
  value[0] = 1;
  std::map<char, int> ss; // char and index
  ss[s[0]] = 0;
  int start = 0;
  for (int i = 1; i < size; ++i) {
    const bool new_str = ss.find(s[i]) == ss.end();
    if (new_str) {
      value[i] = value[i - 1] + 1;
      ss[s[i]] = i;
    } else {
      int old_index = ss[s[i]];
      ss[s[i]] = i; // update to new index
      if (old_index < start) {
        value[i] = i - start + 1;
      } else {
        value[i] = i - old_index;
        start = old_index + 1;
      }
      // std::cout << "value " << s[i] << " in index " << i << " " << old_index << " is " << value[i] << "\n";
    }
  }
  int max_size = 0;
  int max_index = 0;
  for (int i = 0; i < size; ++i) {
    if (value[i] > max_size) {
      max_size = value[i];
      max_index = i;
    }
  }
  std::cout << "max substr size: " << max_size << " in index " << max_index << "\n";
  std::string output_string = "";
  for (int i = max_index - max_size + 1; i < max_index + 1; ++i) {
    output_string += s[i];
  }
  std::cout << "input string: " << s << " max substring " << output_string << "\n";
  return max_size;
}

